  `total` tinyint NOT NULL DEFAULT '0',
  `wage` int NOT NULL,
  `nation_id` bigint DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKc5phn63uc7vq3m4jq0ndi48e0` (`nation_id`),
  CONSTRAINT `FKc5phn63uc7vq3m4jq0ndi48e0` FOREIGN KEY (`nation_id`) REFERENCES `nation` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=218 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
