INSERT INTO `student_job` VALUES (73,'#FF165C',0,10,'-급식시간 급식차를 가지고 와서 배식을 합니다.\n-정리정돈 자격증 5급이상','worker_male.png','','급식배식원',4,0,127),(74,'#FF165C',0,10,'-급식 후 남은 잔반을 정리합니다\n-잔반에 무게를 측정하고 국세청에 신고합니다.\n-정리정돈 자격증 5급 이상','worker_male.png','','급식정리원',2,0,127),(75,'#FF165C',0,10,'-교실에 필요한 각종 작품을 제작합니다.\n-교실 뒤쪽 게시판을 관리합니다.\n-디자인 자격증','worker_male.png','','인테리어디자이너',1,0,127),(76,'#A6D953',0,10,'-청소도구함을 관리합니다\n-매주 금요일 아침 분리수거를 담당합니다.\n-정리정돈 자격증 6급 이상\n-2주 동안 지각 없는 사람','worker_male.png','','환경미화원',1,0,127),(77,'#4A87FF',0,10,'-교실 환기를 담당합니다.(아침자습시간, 점심시간)\n-과학 자격증 4급 이상','worker_male.png','','기상청장',1,0,127),(78,'#7BD979',0,10,'-제출물이나 교과서 등을 걷거나 나누어줍니다.\n-운전면허 필요','weather_caster.png','','우체부',1,0,127),(79,'#FAC91D',0,10,'-월급날이 되면 월급을 확인해줍니다.\n-예금을 관리하고 만기인 사람에게 알려줍니다.','worker_female.png','','은행원',1,0,127),(80,'#A6D953',0,10,'-우리반 교실 앞 뒤 게시판을 관리합니다.\n-매일 날짜와 시간표를 바꿉니다.\n-자격증 4급 이상 2개','worker_male.png','','게시판담당자',1,0,127),(81,'#634AFF',0,10,'-우리 반 과자 창고를 관리하고 과자 및 쿠폰을 판매합니다.\n-자격증 4급 2개 이상','worker_female.png','','도매상인',1,0,127),(82,'#7BD979',0,10,'-손소독기와 에어컨 조절기, 패드 관리함을 관리합니다.\n-과학자격증 4급','firefighter.png','','엔지니어',1,0,127),(83,'#FF165C',0,7,'-분실물 관리함, 보드게임, 피구공 대여명단을 관리합니다.\n-바른글씨 자격증, 신용등급 7등급','worker_male.png','','보드게임관리인',1,0,127),(84,'#FF4A4A',0,10,'-신청곡을 받아 점심시간에 틀어줍니다.\n-자격증 4급 2개 이상','worker_female.png','','DJ',1,0,127),(85,'#FAC91D',0,10,'-주식거래를 관리하고 투자게시판을 관리합니다.\n-수학자격증 5급, 바른글씨 자격증','worker_female.png','','투자회사직원',1,0,127),(86,'#7BD979',0,10,'-국무총리, 경제부총리, 사회부총리','worker_male.png','','공무원',3,0,127),(118,'#FF165C',0,6,'불을 끄는 소방관','firefighter.png','','소방관',1,340,404),(119,'#4AB6A9',0,6,'날씨요정','weather_caster.png','','기상캐스터',0,360,404),(120,'#FF4A4A',0,6,'교실을 깨끗히 하는 교실 청소부','cleaner.png','','교실 청소부',3,400,404),(122,'#4AB6A9',0,6,'매주 금요일 아침 분리수거 \n평소 분리수거함 정리','garbage_collector.png','','쓰레기 분리업체',2,450,404),(123,'#FF165C',0,6,'각종 게시물 게시 및 시간표 관리','reporter.png','','신문기자',0,320,404),(124,'#634AFF',0,6,'가정 통신문 나눠주기 및 반 친구들 숙제 걷어서 제출하기','postman.png','','우체부',0,3