  `title` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `nation_id` bigint DEFAULT NULL,
  `student_id` bigint DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKa7nx4npctpncsq55f666u8r7p` (`nation_id`),
  KEY `FKn3w07etnrmnj9kcwndguioug9` (`student_id`),
